import NavBar from '../../Components/Navbar/NavBar'
import axio from '../../Constants/axios'

function Shop() {
    useEffect (() => {
        axio.get('shop/products').then((response) => {
            const data = response.data
            console.log(data);
        })
        console.log('DONE');
    })
  return (
    <div>
        <NavBar/>
    </div>
  )
}

export default Shop
